Apartamento T2, em condomínio fechado, bem localizado próximo à zona Industrial da Feiteira em Grijó,
O imóvel de 2 quartos, fica em local sossegado com vistas panorâmicas, tendo exposição solar de nascente, excelentes áreas, onde podemos encontrar uma sala espaçosa com lareira, ampla cozinha, equipada com eletrodomésticos embutidos,1 com roupeiro, 2º quarto espaços, hall de entrada e corredor 1wc completo. 
