Excelente apartamento num prédio novo, próximo da Universidade Fernando Pessoa, do Jardim de Arca de Água e do Hospital e S. João, com 55 m2. O apartamento localiza-se ao nível do terceiro andar, têm elevador e parque fechado para dois carros. Têm duas frentes (frente e traseiras): poente e nascente e muita luz direta. A localização é muito central.
Descrição:
- Um bom quarto, com muita luz, virado a nascente;
- Quarto/Sala ampla, muito luminosa, virada a poente;
- Casa de banho completa;
- A cozinha tem muita luz e está totalmente equipada e mobilada. Os eletrodomésticos novos são de encastre: forno, placa vitrocerâmica e exaustor;
- Tem uma lavandaria;
- Aquecimento de águas com cilindro elétrico;
- Instalação de TV cabo em todo apartamento;
- Pavimento de madeira;
- Caixilharias em alumínio novas todas com janelas de vidro duplo;
- Dois lugares de garagem no edifício;
- Excelente localização, zona residencial calma e sossegada. Fica próximo do carvalhido e dos Jardins da Arca d´Água, Campo Lindo, Rua de Vale Formoso e da Universidade Fernando Pessoa. Tem todo o tipo de comércios e serviços à porta: supermercados, farmácia, mercearia, papelaria, pichelaria, cafés, restaurantes, confeitarias, mercearia, florista, cabeleireiro, esteticista, barbeiro, loja de eletrodomésticos, pneus, oficinas auto e transportes públicos (SCTP). Fica próximo das universidades e dos acessos à VCI e autoestradas. 
